import { Component } from 'react';

export const TracksResults = props => {
	return (
		<ul>
			{props.tracks.map(track => {
				return (
					<li key={track.id} onClick={track.id}>
						{track.name} - {track.artists[0].name} ({track.popularity})
					</li>
				);
			})}
		</ul>
	);
};

export default TracksResults;
